    func input()  -> [Input]
    
    /**
     * Serializes the PSBT into a JSON string representation.
     */
    func jsonSerialize()  -> String
    
    /**
     * Serialize the PSBT into a base64-encoded string.
     */
    func serialize()  -> String
    
    /**
