// See https://github.com/mozilla/uniffi-rs/issues/396 for further discussion.
/**
 * The type of address.
 */

public enum AddressData {
    
    /**
     * Legacy.
     */
    case p2pkh(pubkeyHash: String
    )
    /**
     * Wrapped Segwit
     */
    case p2sh(scriptHash: String
    )
    /**
     * Segwit
     */
    case segwit(witnessProgram: WitnessProgram
    )
}


