        case let .transactionRejected(wtxid,reason):
            writeInt(&buf, Int32(7))
            FfiConverterString.write(wtxid, into: &buf)
            FfiConverterOptionString.write(reason, into: &buf)
            
        
        case .evaluatingFork:
            writeInt(&buf, Int32(8))
        
        
